  \"Accelerated Aging in Electrolytic Capacitors for Prognostics\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:03:51.362792\",\n\t\"name\": \"accelerated-aging-in-electrolytic-capacitors-for-prognostics\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The focus of this work is the analysis of
  different degradation phenomena based on thermal overstress and electrical overstress
  accelerated aging systems and the use of accelerated aging techniques for prognostics
  algorithm development. Results on thermal overstress and electrical overstress experiments
  are presented. In addition, preliminary results toward the development of physics-based
  degradation models are presented focusing on the electrolyte evaporation failure
  mechanism. An empirical degradation model based on percentage capacitance loss under
  electrical overstress is presented and used in: (i) a Bayesian-based implementation
  of model-based prognostics using a discrete Kalman filter for health state estimation,
  and (ii) a dynamic system representation of the degradation model for forecasting
  and remaining useful life (RUL) estimation. A leave-one-out validation methodology
  is used to assess the validity of the methodology under the small sample size constrain.rnThe
  results observed on the RUL estimation are consistent through the validation tests
  comparing relative accuracy and prediction error. It has been observed that the
  inaccuracy of the model to represent the change in degradation behavior observed
  at the end of the test data is consistent throughout the validation tests, indicating
  the need of a more detailed degradation model or the use of an algorithm that could
  estimate model parameters on-line. Based on the observed degradation process under
  different stress intensity with rest periods, the need for more sophisticated degradation
  models is further supported. The current degradation model does not represent the
  capacitance recovery over rest periods following an accelerated aging stress period.\",\n\t\"license_title\":
